import React from "react";
import './NewCollections.css'
import { Card } from '../Category Components/Card'
import new_collection from '../Assets/new_collections'

export const NewCollection = () =>{
    return(
        <div className="new-collections">
            <h1>New Collections</h1>
            <hr/>
            <div className="collections">
            {
            new_collection.map((newCollection,i) => {
                return <Card key={i} id={newCollection.id} image={newCollection.image} title={newCollection.title} new_price={newCollection.new_price} prev_price={newCollection.prev_price}/> 
            })
           }
            </div>
        </div>
    )
}
